        <div className="row">
        <a className="btn btn-outline-danger col-sm-1"> X {this.props.product.title} | ${this.props.product.price}</a>
        {/* <p className="col-sm-11" >{this.props.product.title} | <b>${this.props.product.price}</b></p> */}
        </div>
      </li>
    );
  }
}

